 Alone residents. ⁣\n⁣\nI attended High School in Hartford, CT composed of 44.3% Hispanic or Latino residents, 35.3% Black or African American, 14.8% White, 2.93% Asian, 0.602% Other Race, 0.0482% American Indian \u0026 Alaska Native (0.0482%), and 0% Native Hawaiian \u0026 Other Pacific Islander Alone residents. ⁣\n⁣\nI have come from a place where I was sheltered from the problems that are our country’s reality but that will not stop me from standing up for what I believe in. ⁣\n⁣\nBlack men, women, children, are dying. We need to speak up. 𝐏𝐨𝐥𝐢𝐜𝐞 𝐛𝐫𝐮𝐭𝐚𝐥𝐢𝐭𝐲 𝐢𝐬 𝐫𝐞𝐚𝐥, 𝐫𝐚𝐜𝐢𝐬𝐦 𝐢𝐬 𝐫𝐞𝐚𝐥, 𝐰𝐡𝐢𝐭𝐞 𝐩𝐫𝐢𝐯𝐢𝐥𝐞𝐠𝐞 𝐢𝐬 𝐫𝐞𝐚𝐥. It is OUR responsibility.⁣\n⁣\nIn 2018 there were 996 fatal police shootings, 2019 this increased to 1,004, and 5 months into 2020 we are at 228. ⁣\n⁣\n𝐒𝐭𝐨𝐩 𝐝𝐨𝐢𝐧𝐠 𝐧𝐨𝐭𝐡𝐢𝐧𝐠.","isCrawlable":true,"thumbnail":{"thumbnails":[{"url":"https://i.ytimg.com/vi/ipYnR0QxyCg/hqdefault.jpg?sqp=-oaymwEiCKgBEF5IWvKriqkDFQgBFQAAAAAYASUAAMhCPQCAokN4AQ==\u0026rs=AOn4CLBNVXO1IW37u4wn0rEgeKUCLFXoxA","width":168,"height":94},{"url":"https://i.ytimg.com/vi/ipYnR0QxyCg/hqdefault.jpg?sqp=-oaymwEiCMQBEG5IWvKriqkDFQgBFQAAAAAYASUAAMhCPQCAokN4AQ==\u0026rs=AOn4CLDVcNU4cFJ1d3E0q-KZRJMQ9cpr0A","width":196,"height":110},{"url":"https://i.ytimg.com/vi/ipYnR0QxyCg/hqdefault.jpg?sqp=-oaymwEjCPYBEIoBSFryq4qpAxUIARUAAAAAGAElAADIQj0AgKJDeAE=\u0026rs=AOn4CLBXTBmYe74ZAig6OMaRYKTOf3JZSQ","width":246,"height":138},{"url":"https://i.ytimg.com/vi/ipYnR0QxyCg/hqdefault.jpg?sqp=-oaymwEjCNACELwBSFryq4qpAxUIARUAAAAAGAElAADIQj0AgKJDeAE=\u0026rs=AOn4CLBLGz5CGxcAxPZDkbYmnEIExfdwtQ","width":336,"height":188},{"url":"https://i.ytimg.com/vi/ipYnR0QxyCg/maxresdefault.jpg","width":1920,"height":1080}]},"allowRatings":true,"viewCount":"14877","author":"JULIA TAYLOR","isPrivate":false,"isUnpluggedCorpus":false,"isLiveContent":false},"annotations":[{"playerAnnotationsExpandedRenderer":{"featuredChannel":{"startTimeMs":"0","endTimeMs":"109000","watermark":{"thumbnails":[{"url":"https://i.ytimg.com/an/5Isss4zMs5ILLBRtWE0wrw uBxOpvsFehekkEazSDUik7QQ","recommendedLevel":2,"highResolutionRecommendedLevel":2}},"microformat":{"playerMicroformatRenderer":{"thumbnail":{"thumbnails":[{"url":"https://i.ytimg.com/vi/ipYnR0QxyCg/maxresdefault.jpg","width":1280,"height":720}]},"embed":{"iframeUrl":"https://www.youtube.com/embed/ipYnR0QxyCg?list=PLbpi6ZahtOH4v9Ijdd2VvRjfSGdOtJnFK","width":1280,"height":720},"title":{"simpleText":"DEAR WHITE PEOPLE.... justice for George Floyd (and many more)"},"description":{"simpleText":"“𝘑𝘶𝘴𝘵𝘪𝘤𝘦 𝘸𝘪𝘭𝘭 𝘯𝘰𝘵 𝘣𝘦 𝘴𝘦𝘳𝘷𝘦𝘥 𝘶𝘯𝘵𝘪𝘭 𝘵𝘩𝘰𝘴𝘦 𝘸𝘩𝘰 𝘢𝘳𝘦 𝘶𝘯𝘢𝘧𝘧𝘦𝘤𝘵𝘦𝘥 𝘢𝘳𝘦 𝘢𝘴 𝘰𝘶𝘵𝘳𝘢𝘨𝘦𝘥 𝘢𝘴 𝘵𝘩𝘰𝘴𝘦 𝘸𝘩𝘰 𝘢𝘳𝘦.” -𝘉𝘦𝘯𝘫𝘢𝘮𝘪𝘯 𝘍𝘳𝘢𝘯𝘬𝘭𝘪𝘯.⁣\n⁣\nMy name is Julia Veronesi, I was born in Colchester, CT composed of 90.4% White Alone residents, 2.71% Hispanic or Latino, 0.758% Asian, 0.471% American Indian \u0026 Alaska Native, 0% Native Hawaiian \u0026 Other Pacific Islander, 0% Other Race, and 2.44% Black or African American Alone residents. ⁣\n⁣\nI attended High School in Hartford, CT composed of 44.3% Hispanic or Latino residents, 35.3% Black or African American, 14.8% White, 2.93% Asian, 0.602% Other Race, 0.0482% American Indian \u0026 Alaska Native (0.0482%), and 0% Native Hawaiian \u0026 Other Pacific Islander Alone residents. ⁣\n⁣\nI have come from a place where I was sheltered from the problems that are our country’s reality but that will not stop me from standing up for what I believe in. ⁣\n⁣\nBlack men, women, children, are dying. We need to speak up. 𝐏𝐨𝐥𝐢𝐜𝐞 𝐛𝐫𝐮𝐭𝐚𝐥𝐢𝐭𝐲 𝐢𝐬 𝐫𝐞𝐚𝐥, 𝐫𝐚𝐜𝐢𝐬𝐦 𝐢𝐬 𝐫𝐞𝐚𝐥, 𝐰𝐡𝐢𝐭𝐞 𝐩𝐫𝐢𝐯𝐢𝐥𝐞𝐠𝐞 𝐢𝐬 𝐫𝐞𝐚𝐥. It is OUR responsibility.⁣\n⁣\nIn 2018 there were 996 fatal police shootings, 2019 this increased to 1,004, and 5 months into 2020 we are at 228. ⁣\n⁣\n𝐒𝐭𝐨𝐩 𝐝𝐨𝐢𝐧𝐠 𝐧𝐨𝐭𝐡𝐢𝐧𝐠."},"lengthSeconds":"130","ownerProfileUrl":"http://www.youtube.com/@juliataylorveronesi","externalChannelId":"UC5Isss4zMs5ILLBRtWE0wrw","isFamilySafe":true,"availableCountries":["AD","AE","AF","AG","AI","AL","AM","AO","AQ","AR","AS","AT","AU","AW","AX","AZ","BA","BB","BD","BE","BF","BG","BH","BI","BJ","BL","BM","BN"  where I was sheltered from the problems that are our country’s reality but that will not stop me from standing up for what I believe in. ⁣\n⁣\nBlack men, women, children, are dying. We need to speak up. 𝐏𝐨𝐥𝐢𝐜𝐞 𝐛𝐫𝐮𝐭𝐚𝐥𝐢𝐭𝐲 𝐢𝐬 𝐫𝐞𝐚𝐥, 𝐫𝐚𝐜𝐢𝐬𝐦 𝐢𝐬 𝐫𝐞𝐚𝐥, 𝐰𝐡𝐢𝐭𝐞 𝐩𝐫𝐢𝐯𝐢𝐥𝐞𝐠𝐞 𝐢𝐬 𝐫𝐞𝐚𝐥. It is OUR responsibility.⁣\n⁣\nIn 2018 there were 996 fatal police shootings, 2019 this increased to 1,004, and 5 months into 2020 we are at 228. ⁣\n⁣\n𝐒𝐭𝐨𝐩 𝐝𝐨𝐢𝐧𝐠 𝐧𝐨𝐭𝐡𝐢𝐧𝐠.","styleRuns":[{"startIndex":0,"length":1315,"styleRunExtensions":{"styleRunColorMapExtension":{"colorMap":[{"key":"USER_INTERFACE_THEME_DARK","value":4294967295},{"key":"USER_INTERFACE_THEME_LIGHT","value":4279440147}]}},"fontFamilyName":"Roboto"}]},"headerRuns":[{"startIndex":0,"length":1315,"headerMapping":"ATTRIBUTED_STRING_HEADER_MAPPING_UNSPECIFIED"}]}},{"videoDescriptionTranscriptSectionRenderer":{"sectionTitle":{"runs":[{"text":"Transcript"}]},"subHeaderText":{"runs":[{"text":"Follow along using the transcript."}]},"primaryButton":{"buttonRenderer":{"style":"STYLE_SUGGESTIVE","size":"SIZE_DEFAULT","isDisabled":false,"text":{"runs":[{"text":"Show transcript"}]},"trackingParams":"CCAQtooIIhMI2MzWwrXthwMVNUm4BB3DeSv8","command":{"clickTrackingParams":"CCAQtooIIhMI2MzWwrXthwMVNUm4BB3DeSv8","commandExecutorCommand":{"commands":[{"clickTrackingParams":"CCAQtooIIhMI2MzWwrXthwMVNUm4BB3DeSv8","showEngagementPanelEndpoint":{"panelIdentifier":"engagement-panel-searchable-transcript","sourcePanelIdentifier":"video-description-ep-identifier"}},{"clickTrackingParams":"CCAQtooIIhMI2MzWwrXthwMVNUm4BB3DeSv8","scrollToEngagementPanelCommand":{"targetId":"engagement-panel-searchable-transcript"}}]}}}},"trackingParams":"CB8Q0YQIGAIiEwjYzNbCte2HAxU1SbgEHcN5K_w="}},{"videoDescriptionInfocardsSectionRenderer":{"sectionTitle":{"simpleText":"JULIA TAYLOR"},"creatorVideosButton":{"buttonRenderer":{"style":"STYLE_INACTIVE_OUTLINE","size":"SIZE_DEFAULT","isDisabled":false,"text":{"simpleText":"Videos"},"icon":{"iconType":"MY_VIDEOS"},"trackingParams":"
